import React from 'react'
import { Link, useLocation } from 'react-router-dom';

function NavBar(){
  const location = useLocation();

  return (
    <header className="App-header">
      <a href="/">swiftEntry</a>
      {location.pathname !== '/signin' && <Link to="/signin" className="link-style">Sign In</Link>}
      {location.pathname !== '/signup' && <Link to="/signup" className="link-style">Create Account</Link>}
    </header>
  )
}

export default NavBar
